fn main() {
    let mut sum = 0;
    let rows = input.split("\n").collect::<Vec<&str>>();
    for (i, row) in rows.iter().enumerate() {
        let chars = row.chars().collect::<Vec<char>>();
        for (j, c) in chars.iter().enumerate() {
            if *c == 'A' && i > 0 && j > 0 && i < rows.len() - 1 && j < chars.len() - 1 {
                let up_left = rows[i - 1].chars().nth(j - 1).unwrap();
                let up_right = rows[i - 1].chars().nth(j + 1).unwrap();
                let bottom_left = rows[i + 1].chars().nth(j - 1).unwrap();
                let bottom_right = rows[i + 1].chars().nth(j + 1).unwrap();

                let up_left_bottom_right =
                    (up_left, bottom_right) == ('M', 'S') || (up_left, bottom_right) == ('S', 'M');
                let up_right_bottom_left =
                    (up_right, bottom_left) == ('M', 'S') || (up_right, bottom_left) == ('S', 'M');

                if up_left_bottom_right && up_right_bottom_left {
                    println!("i:{:?}, j:{:?}, up_left:{:?}, up_right:{:?}, bottom_left:{:?}, bottom_right:{:?}, up_left_bottom_right:{:?}, up_right_bottom_left:{:?}", i, j, up_left, up_right, bottom_left, bottom_right, up_left_bottom_right, up_right_bottom_left);
                    sum += 1;
                }
            }
        }
    }
    println!("sum:{:?}", sum);
}
